import { combineReducers } from "redux";

import {
  findUnitById,
  findUnits,
  deletedById,
  saveUnit,
  addUnits
} from "./units";

import {
  findTransactionsById,
  findTransactions,
  deletedTransactionsById,
  editTransactionById,
  addTransactions
} from "./transactions";

import {
  findStocksById,
  findStocks,
  deletedStocksById,
  editStockById,
  addStocks
} from "./stocks";

export default combineReducers({
  deletedById,
  findUnitById,
  findUnits,
  saveUnit,
  addUnits,
  findTransactionsById,
  findTransactions,
  deletedTransactionsById,
  editTransactionById,
  addTransactions,
  findStocksById,
  findStocks,
  deletedStocksById,
  saveStock,
  addStocks
});
